import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import {FiPower, FiTrash2 } from 'react-icons/fi';


import api from '../../services/api';

import './styles.css';

class Product extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        product: [],
        response: {}
      }
    }



    render() {
      const { error, product} = this.state;

      if(error) {
        return (
          <div>Error: {error.message}</div>
        )
      } else {
        return(
          <div>
            <h2>Product List</h2>

            <table>
              <thead>
                <tr>
                  <th>#ID</th>
                  <th>Product Name</th>
                  <th>SKU</th>
                  <th>Price</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {product.map(product => (
                  <tr key={product.id}>
                    <td>{product.id}</td>
                    <td>{product.product_name}</td>
                    <td>{product.sku}</td>
                    <td>{product.price}</td>

                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )
      }
    }
  }

  export default Product;
